def getClosestValue(diccionario, value, usedLetters: set):
    
    clave_mas_cercana = min(
        (k for k in diccionario if k not in usedLetters),
        key=lambda k: abs(diccionario[k] - value)
    )
    return clave_mas_cercana, diccionario[clave_mas_cercana]

